void qrf_top::thread_ap_clk_no_reset_() {
    if ( ap_rst.read() == ap_const_logic_1) {
        ap_sync_reg_channel_write_Qi_M_imag = ap_const_logic_0;
    } else {
        if (esl_seteq<1,1,1>(ap_const_logic_1, (qrf_top_Loop_1_proc3_U0_ap_done.read() & 
             qrf_top_Loop_1_proc3_U0_ap_continue.read()))) {
            ap_sync_reg_channel_write_Qi_M_imag = ap_const_logic_0;
        } else {
            ap_sync_reg_channel_write_Qi_M_imag = ap_sync_channel_write_Qi_M_imag.read();
        }
    }
    if ( ap_rst.read() == ap_const_logic_1) {
        ap_sync_reg_channel_write_Qi_M_real = ap_const_logic_0;
    } else {
        if (esl_seteq<1,1,1>(ap_const_logic_1, (qrf_top_Loop_1_proc3_U0_ap_done.read() & 
             qrf_top_Loop_1_proc3_U0_ap_continue.read()))) {
            ap_sync_reg_channel_write_Qi_M_real = ap_const_logic_0;
        } else {
            ap_sync_reg_channel_write_Qi_M_real = ap_sync_channel_write_Qi_M_real.read();
        }
    }
    if ( ap_rst.read() == ap_const_logic_1) {
        ap_sync_reg_channel_write_Ri_M_imag = ap_const_logic_0;
    } else {
        if (esl_seteq<1,1,1>(ap_const_logic_1, (qrf_top_Loop_1_proc3_U0_ap_done.read() & 
             qrf_top_Loop_1_proc3_U0_ap_continue.read()))) {
            ap_sync_reg_channel_write_Ri_M_imag = ap_const_logic_0;
        } else {
            ap_sync_reg_channel_write_Ri_M_imag = ap_sync_channel_write_Ri_M_imag.read();
        }
    }
    if ( ap_rst.read() == ap_const_logic_1) {
        ap_sync_reg_channel_write_Ri_M_real = ap_const_logic_0;
    } else {
        if (esl_seteq<1,1,1>(ap_const_logic_1, (qrf_top_Loop_1_proc3_U0_ap_done.read() & 
             qrf_top_Loop_1_proc3_U0_ap_continue.read()))) {
            ap_sync_reg_channel_write_Ri_M_real = ap_const_logic_0;
        } else {
            ap_sync_reg_channel_write_Ri_M_real = ap_sync_channel_write_Ri_M_real.read();
        }
    }
}

